import React, {Component} from "react";

export default class Navigation extends Component{
    render() {
        return (
            <div>
                <nav>
                    <ul>
                        <li><a className="active" href="#home"></a>Home</li>
                        <li><a href="#about"></a>About</li>
                    </ul>
                </nav>
            </div>  
        )
    }
}
